import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Wait for and click the mobile menu toggle (nav-menu)
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.waitForTimeout(1000); // Wait for menu animation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Verify menu is open by checking for mobile menu content
    await page.waitForSelector('#mobileMenuOverlay', { timeout: 5000 });
    const menuContent = await page.textContent('.mobile-menu');

    // Click on a menu item (Electronics)
    await page.waitForSelector('.mobile-menu a[href="#"]', { timeout: 5000 });
    await page.click('.mobile-menu a[href="#"]:has-text("Electronics")');
    await page.waitForTimeout(1000); // Wait for navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_navigation.png'));

    // Close the mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');
    await page.waitForTimeout(1000); // Wait for menu to close
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    // Verify menu is closed by checking overlay is hidden
    const overlayVisible = await page.isVisible('#mobileMenuOverlay');

    return {
      success: true,
      action: "Tested mobile menu navigation - opened menu, navigated to Electronics category, and closed menu",
      extractedData: {
        menuContent: menuContent.substring(0, 100) + '...',
        menuClosed: !overlayVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
